sw x3, 0(x2) # store x3 (0x3737426c) in memory
li x3, 0xa6e89599 # load x2 with 32 LSBs of 0xa6e895993737426c
sw x3, 4(x2) # store x4 (0xa6e89599) in memory 4 bytes after x3
fld f11, 0(x2) # load 0xa6e895993737426c from memory into f11
fadd.d f5, f23, f11, dyn # perform operation
fadd.d f5, f23, f11, rdn # perform operation
fadd.d f5, f23, f11, rmm # perform operation
fadd.d f5, f23, f11, rne # perform operation
fadd.d f5, f23, f11, rtz # perform operation
fadd.d f5, f23, f11, rup # perform operation

 # set fcsr.frm to 0x4 
fsrmi 0x4
fadd.d f5, f23, f11 # perform operation

 # set fcsr.frm to 0x3 
fsrmi 0x3
fadd.d f5, f23, f11 # perform operation

 # set fcsr.frm to 0x2 
fsrmi 0x2
